import { Sidenav } from 'rsuite';

const styles = {
	width: 200,
	display: 'inline-table',
	marginRight: 10
}

const Navigation = ({ ...props }) => {
	return (
		<div>
			<Sidenav>
				<Sidenav.Body>
					<Nav>
						<Nav.Item eventKey="1" active>
							Home
						</Nav.Item>
						<Nav.Item eventKey="2" active>
							Latest Work
						</Nav.Item>
						<Nav.Item eventKey="3" active>
							Complete Works
						</Nav.Item>
					</Nav>
				</Sidenav.Body>
			</Sidenav>
		</div>
	);
};
